import React, {Component} from 'react';
import './AppFooter.css';

class AppFooter extends Component {
    render() {
        return (
            <div className="App-footer"> 
                <p className="Copyright">Copyright@2018</p>
            </div>
        );
    }
}

export default AppFooter;
